// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.6;

contract CircleOfHop {
    event TreeUpdatedVerified(uint256 _treeId);
    event TreeVerified(address signer, uint256 nonce);
    event TreeAssigned(uint256 _treeId);

    function verifyUpdateBatchWithSignature(uint256 _treeId) external {
        emit TreeUpdatedVerified(_treeId);
    }

    function verifyTreeBatchWithSignature(address signer, uint256 nonce)
        external
    {
        emit TreeVerified(signer, nonce);
    }

    function assignTreeBatch(uint256 _treeId) external {
        emit TreeAssigned(_treeId);
    }
}
